import React, { useContext } from 'react';
import './loading.css'
import pocketContext from '../../../context/pocketContext';


const Loading = () => {
  const {
    theme,
  } = useContext(pocketContext);
  return (
  <div class="wrapper" style={ { backgroundColor: theme.backgroundColor } }>
    <div class="circle" style={ { backgroundColor: theme.backgroundColor } }></div>
    <div class="circle" style={ { backgroundColor: theme.backgroundColor } }></div>
    <div class="circle" style={ { backgroundColor: theme.backgroundColor } }></div>
    <div class="shadow" style={ { backgroundColor: theme.backgroundColor } }></div>
    <div class="shadow" style={ { backgroundColor: theme.backgroundColor } }></div>
    <div class="shadow" style={ { backgroundColor: theme.backgroundColor } }></div>
  </div>
)};

Loading.propTypes = {};

Loading.defaultProps = {};

export default Loading;
